import React from 'react';
import Header from './Header';


const CoordinatorProfile = () => {
  return (
    <div>
      <Header user="coordinator" />
      <h1>Coordinator Profile</h1>
      <p>Details about the coordinator will go here...</p>
    </div>
  );
};

export default CoordinatorProfile;
